class Solution(object):
    def countSubarrays(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        N = len(nums)
        prefixes = list()
        prefixes.append(0)
        for num in nums:
            prefixes.append(prefixes[-1] + num)

        def isAllMatch(prefixes, n, k):
            for x in range(N - n + 1):
                prefix = prefixes[x + n] - prefixes[x]
                if prefix * n >= k:
                    return False
            return True

        def isAllNotMatched(prefixes, n, k):
            for x in range(N - n + 1):
                prefix = prefixes[x + n] - prefixes[x]
                if prefix * n < k:
                    return False
            return True

        def countMatch(prefixes, n, k):
            count = 0
            for x in range(N - n + 1):
                prefix = prefixes[x + n] - prefixes[x]
                if prefix * n < k:
                    count += 1
            return count

        left = 1
        right = N

        while left + 1 < right:
            middle = (left + right) // 2
            if isAllMatch(prefixes, middle, k):
                left = middle + 1
            else:
                right = middle - 1

        if isAllMatch(prefixes, right, k):
            low = right
        elif isAllMatch(prefixes, left, k):
            low = left
        else:
            low = left - 1

        left = 1
        right = N

        while left + 1 < right:
            middle = (left + right) // 2
            if isAllNotMatched(prefixes, middle, k):
                right = middle - 1
            else:
                left = middle + 1

        if isAllNotMatched(prefixes, left, k):
            high = left
        elif isAllNotMatched(prefixes, right, k):
            high = right
        else:
            high = right + 1

        ans = 0
        for x in range(low):
            ans += N - x
        for x in range(low + 1, min(len(nums), high)):
            ans += countMatch(prefixes, x, k)
        return ans


